import { expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
test('connect', async () => {
    const r1 = await request('ws://connect.whistlejs.com/index.html');
    expect(r1.type).toBe('server');
    const r2 = await request('ws://connect.whistlejs.com/index.html');
    expect(r2.type).toBe('server');
});
